import './App.css';
import Navbar from './components/Navbar';
import Card from './components/Card';
import placesData from './assets/placesData';

function App() {
  // const ratings = placesData.map(visit => 

  // )
  let stars = []
  for (let i = 0; i < 5; i++) {
    stars.push(<img className="pin" src="https://cdn.iconscout.com/icon/free/png-256/map-pin-1452950-1227762.png"/>)
  }

  const visitedPlaces = placesData.map(visit => 


    <Card
      key={visit.id}
      {...visit}
    />  
  )

  return (
    <div>
      <Navbar/>
      {visitedPlaces}
    </div>
  );
}

export default App;
